import styled from "styled-components";

const ContactForm = styled.form`
  width: 80%;
  display: flex;
  justify-content: center;
  align-items: center;
`;

const ContactPage = () => {
  return (
    <ContactForm>
      <input placeholder="email" />
      <input placeholder="name" />
      <textarea placeholder="Content" />
    </ContactForm>
  );
};
export default ContactPage;
